The present invention relates to thioic acids according to formula I, suitable as building block for polythioesters;

Wherein X is O, N or S and whereby 
R1 is chosen from (-CH 2 -) 2 , -CH 2 -O-CH 2 - or (-CH 2 -) 3  ; 
if R1=(-CH2-)2 and X=O, R2 is chosen from a non-degradable polymer with a Mw>6000, a degradable polymer or oligomer, an aliphatic compound comprising at least 2 C atoms and a Mw<5000 or an aromatic compound comprising at least 2 aromatic rings; 
if R1=(-CH2-)2 and X=N or S or if R1=(-CH2-)3, R2 is chosen from a monomer, oligomer or polymer. 
If R1 = (-CH2-)2, R2 is preferably chosen from polyethyleneglycol (PEG) with a Mw>6000 or a degradable polymer or oligomer. 
If R1=(-CH2-)2 and X=N or S or if R1=(-CH2-)3, R2 is preferably chosen from a biodegradable oligomer or polymer chosen from poly (lactide) (PLLA), polyglycolide (PGA), co-oligomers or copolymers of PLA and PGA (PLGA), poly(anhydrides), poly(trimethylenecarbonates), poly(orthoesters), poly(dioxanones), poly(ε-caprolactones) (PCL) or polyesteramides.
